INSERT INTO `member` VALUES ('1881', '杨文超', '13802880712', null, '0', '/public/uploads/imgs/head/1575207623.png', '/public/uploads/imgs/emoticon/默认表情包.jpg', '监控分析室', '项目组', '男', '21190397', 'yangwenchao2', '1、负责推动新监控大厅的入驻及投产使用，并在搬迁后负责大厅内网络设备及系统的维护和管理。\n2、负责南方基地园区传输的建设工作；\n3、负责室内运维支撑手段的自主开发支撑工作；\n4、负责室内项目的预算管理、开支管控、质量管理、审计管理等方面工作；\n5、负责室内已有系统的使用支撑及维护、优化与管理，确保其正常运作；\n6、负责园区无线网络的保障工作。', '2019-10-21 10:09:13', '0000-00-00 00:00:00');
