INSERT INTO `member` VALUES ('1893', '陈卓永', '13802880455', '', '0', '/public/uploads/imgs/head/1575207018.png', '/public/uploads/imgs/emoticon/默认表情包.jpg', '监控分析室', '监控组-组长', '男', '21015234', 'chenzhuoyong', '																								1、国际光传送网EM：负责国际传送网境内侧和离境系统境内侧、国际政企专网的7*24小时告警监控、割接调度、故障管理、投诉处理等；\r\n2、移动云监控及投诉处理：负责移动云7*24小时告警监控、故障管控、变更管理、安全事件受理及调度、信息发布等工作；负责5*9小时移动云投诉处理工作，包括客户报障、客户咨询、服务请求等；\r\n3、IDC监控：负责对IDC的链路、关键节点进行7*24小时的通断性及流量监控、故障管控、安全事件受理和信息发布等工作；\r\n4、西藏、香港网络监控：负责7*9小时监控、重大/严重故障的闭环管理，包括故障发现和上报、指挥调度、故障跟踪和信息发布等工作；\r\n5、园区动力监控：负责园区机房动力、环境量的7*24小时的告警监控、故障管理、割接配合等；\r\n6、园区传输管理：包括园区传输网络7*24小时告警监控、故障处理；同时兼管园区传输割接调度等。\r\n																		', '2019-10-21 10:09:13', '2020-01-18 14:57:06');
