CREATE TABLE `task_items_management` (
  `tim_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id，工作项管理表，配合岗位管理表可以用于制作交接班表模具',
  `tim_parent_id` int(11) NOT NULL COMMENT '父级id，默认0表示没有父级，不过最准确的是tim_level字段为1时',
  `tim_name` varchar(255) DEFAULT NULL COMMENT '工作项名称',
  `tim_level` int(11) NOT NULL DEFAULT '1' COMMENT '默认为1（最高父级），子级自动加一，不限制级别深度',
  `tim_sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序，默认为0',
  `tim_type` int(11) NOT NULL DEFAULT '1' COMMENT '工作项类型：默认1，1-基本类型、2-引用类型',
  `ctrr_rsrm_id` int(11) DEFAULT NULL COMMENT '小本本字段结构id，仅为引用类型的工作项时才有效',
  `tim_tips` varchar(255) DEFAULT NULL COMMENT '工作项提示信息',
  `tim_is_editable` int(255) NOT NULL DEFAULT '1' COMMENT '是否可修改的工作项结构，1：可修改，0：不可修改；重要任务项可设置为不可修改，只有超级管理员可以编辑该字段',
  `tim_is_delete` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除状态，0-非删除，1-删除，默认0',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '自动更新',
  PRIMARY KEY (`tim_id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of task_items_management
-- ----------------------------

-- ----------------------------
-- Table structure for transport_support_log_data
-- ----------------------------
DROP TABLE IF EXISTS `transport_support_log_data`;
CREATE TABLE `transport_support_log_data` (
  `tslmD_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `tslm_id_l2` int(11) DEFAULT NULL COMMENT '二级表ctrr_rsrm_id',
  `tslmD_data` text COMMENT 'text类型字段（几m数据没问题），保存json格式数据，id:value',
  `tslmD_is_solidification` int(11) NOT NULL DEFAULT '0' COMMENT '一二级字段是否固化，1-是，0-否，固化的数据一二级字段将固定不变，固化的时机有两次：首次创建数据时，自动生成一二级字段内容，以防意外；第二次是手动点击固化按钮，将当前的一二级字段数据更新并将本字段置为1',
  `levelOneName` varchar(255) DEFAULT NULL COMMENT '当数据固化时才有效，一级字段名，首次新增数据时，会赋予一个初始值，该值为当前一级分类的值',
  `levelTwoName` varchar(255) DEFAULT NULL COMMENT '当数据固化时才有效，二级字段名，首次新增数据时，会赋予一个初始值，该值为当前2级分类的值',
  `star_state` int(11) NOT NULL DEFAULT '0' COMMENT '数据当前星标状态，0-无，1-标星',
  `flag_state` int(11) NOT NULL DEFAULT '0' COMMENT '数据当前红旗状态，0-无，1-红旗',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '自动更新',
  PRIMARY KEY (`tslmD_id`)
) ENGINE=InnoDB AUTO_INCREMENT=63 DEFAULT CHARSET=utf8 COMMENT='传输支撑日志记录主记录表';

