-- ----------------------------
-- Table structure for transport_support_log_management
-- ----------------------------
DROP TABLE IF EXISTS `transport_support_log_management`;
CREATE TABLE `transport_support_log_management` (
  `tslm_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `tslm_name` varchar(255) DEFAULT NULL COMMENT '名称',
  `tslm_level` int(11) DEFAULT NULL COMMENT '级别：1-一级表、2-二级表、3-字段',
  `tslm_parent_id` int(11) DEFAULT NULL COMMENT '父id',
  `tslm_type` int(11) DEFAULT '1' COMMENT '类型：1-text、2-switch、3-select、6-单个时间',
  `tslm_valueFortype` varchar(255) DEFAULT NULL COMMENT '字段值：格式为逗号隔开的字符串；当字段类型为时switch时，可为：‘是，否’；当字段类型为select时，可为‘线路外力破坏，线路劣化，设备，网管，连接单元，其它’；当字段类型为date时，可为：时间范围（ctrr_rsrm_valueFortype = 字段1（开始时间），字段2（结束时间））、计算时长（ctrr_rsrm_valueFortype = 字段1（时间范围字段的ctrr_rsrm_id）、时间选择器（单个时间值，ctrr_rsrm_valueFortype = ''''）',
  `tslm_sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `tslm_tips` varchar(255) DEFAULT NULL COMMENT '字段填写提示/格式要求等',
  `tslm_is_needed` int(11) NOT NULL DEFAULT '0' COMMENT '是否必须字段：必填 1、非必填 0 （仅对字段有效）',
  `tslm_is_key` int(11) NOT NULL DEFAULT '0' COMMENT '是否主键性质的字段：比如工单ID，每张表格只能有一个主键类型字段',
  `tslm_is_active` int(11) NOT NULL DEFAULT '1' COMMENT '状态：1-正常、0-删除',
  `tslm_is_fixed` int(11) NOT NULL DEFAULT '0' COMMENT '是否重要字段：重要字段固定不可修改，1：固定，0：非固定',
  `tslm_remarks` varchar(255) DEFAULT NULL COMMENT '备注与说明',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '自动更新',
  PRIMARY KEY (`tslm_id`)
) ENGINE=InnoDB AUTO_INCREMENT=588 DEFAULT CHARSET=utf8 COMMENT='传输日志结构管理表';

-- ----------------------------
-- Records of transport_support_log_management
-- ----------------------------

-- ----------------------------
-- Table structure for wx_menu
-- ----------------------------
DROP TABLE IF EXISTS `wx_menu`;
CREATE TABLE `wx_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) DEFAULT NULL COMMENT '父级id',
  `button_level` varchar(30) DEFAULT NULL COMMENT '菜单类型   button 一级菜单（最多3个）, sub_button 二级菜单（最多5个）',
  `type` varchar(255) DEFAULT NULL COMMENT '动作类型，view，click，miniprogram',
  `wx_name` varchar(60) DEFAULT NULL COMMENT '菜单标题',
  `key` varchar(128) DEFAULT NULL COMMENT '菜单KEY值，用于消息接口推送',
  `url` varchar(1024) DEFAULT NULL COMMENT 'view、miniprogram类型必须',
  `res_type` varchar(30) DEFAULT NULL COMMENT '自动回复类型   news图文   image图片',
  `media_id` varchar(255) DEFAULT NULL COMMENT '回复内容',
  `imgurl` varchar(255) DEFAULT NULL COMMENT '图片url   响应图片素材的图片',
  `content` varchar(500) DEFAULT NULL COMMENT '回复文本内容',
  `appid` varchar(255) DEFAULT NULL COMMENT 'appid  miniprogram类型必须',
  `pagepath` varchar(255) DEFAULT NULL COMMENT 'pagepath miniprogram类型必须',
  `sort` tinyint(3) DEFAULT NULL COMMENT '排序',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  UNIQUE KEY `id` (`id`),
  KEY `parent_id` (`parent_id`),
  KEY `key` (`key`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of wx_menu
-- ----------------------------

-- ----------------------------
-- Table structure for wx_welcome
-- ----------------------------
DROP TABLE IF EXISTS `wx_welcome`;
CREATE TABLE `wx_welcome` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `res_type` varchar(255) DEFAULT NULL COMMENT '关注回复内容类型   text   news   image',
  `content` varchar(1000) DEFAULT NULL COMMENT '回复文本内容',
  `media_id` varchar(255) DEFAULT NULL COMMENT '回复素材id',
  `imgurl` varchar(255) DEFAULT NULL COMMENT '回复图片的url',
  `status` tinyint(1) DEFAULT '2' COMMENT '状态    1启用   2禁用   默认禁用',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

